    const n = fns.length;
    const result = map(() => [], Array(n));
    const rest = [];
    for (let arrI = 0; arrI < arr.length; arrI++) {
        const value = arr[arrI];
        let fnsI;
        for (fnsI = 0; fnsI < n; fnsI++) {
            if (fns[fnsI](value, arrI, arr)) {
                result[fnsI].push(value);
                break;
